ESC エンジンシールコート 

ガソリン、ディーゼルエンジンのゴムシール部
からのオイルのにじみ、漏れを防止する添加剤です。
油膜を向上させ、バルブシールからのオイルさがりを
防止します。また、PCVバルブを洗浄し、機能を回復させます。<br>
<br> 
品名 ESC エンジンシールコート<br> 
<br> 
添加量 オイル量3～6Lに1本を使用<br>
<br>
