添加するだけで冷却液の防錆・防食・消泡性能を復活させ、交換作業に伴う廃冷却液の排出量が抑制できます。<br />
ラジエーター、エンジンの材質に関係なく使用できます。<br />
また交換作業を省略できるので、エア抜きなど困難で時間のかかる作業が省略できます。<br />
冷却系に溜まった錆や水アカ等は除去しないので、注入時は汚れ具合を確認してください。<br /><br />
