ディーゼルインジェクター専用燃料添加剤<br><br>次世代型ディーゼルエンジンの主力部品である「コモンレールインジェクションシステム」は、排出ガスのクリーン化や燃費向上、振動低減など様々な恩恵を受けることが出来る「精密制御機械」です。<br>しかし、燃料に超高圧・高温という負荷がかかることで、従来の汚れとは異なるラッカー状汚れをインジェクター内部に発生させ、不具合の原因となることが知られてきました。<br>超精密機械であり精度の高い制御が行えるということは、微細な汚れが大きなトラブルに繋がり易いという側面を合わせ持つことにもなるのです。<br>そこで、このインジェクター内部に発生する微少なラッカー状汚れを洗浄するため、より強力なインジェクター洗浄専用軽油添加剤を開発いたしました。<br><br>品名＿＿＿D-1　ディーゼルワン<br>容量＿＿＿200ml<br><br><br>●特長<br>&#8226;高性能清浄剤および特殊溶剤のダブル清浄効果により、インジェクター内部を洗浄し、エンジンの燃焼を改善します。<br>
&#8226;エンジン振動を低減し、始動性を向上するとともに、新車時の走行感を取り戻します。<br>
&#8226;従来型ディーゼルエンジンにも有効です。<br><br>●使用方法<br>&#8226;ディーゼルエンジン全般に使用できます。<br>
&#8226;燃料50～200Lに対して、本製品1本を燃料タンクに注入してください。<br>
50L未満の場合は2%を超えないように添加してください。<br><br><img src=" http://image.rakuten.co.jp/ainekusu/cabinet/02409470/02603351/imgrc0068679484.jpg"><br><br>●使用上の注意<br>&#8226;口に入れたり、皮膚に付着したりしないよう注意してください。<br>
&#8226;塗装に付着した場合は、速やかに拭き取ってください。<br>
&#8226;燃料に対し2%以上の濃度では使用しないでください。<br>
&#8226;D-1を使用しても症状が回復しない場合、EGRやDPF,吸気系など、他の箇所でのトラブルが考えられますので、専門の技術者や整備士にご相談ください。<br>
&#8226;本品使用前に、水分分離器の水抜きや燃料フィルターの交換を行ってください。<br>
<font color="red">&#8226;用途以外に使用しないでください。<br>
